class Gendalf {
  constructor(selector, type = 3, audio = false) {
    this.type = type;
    this.selector = selector || "";
    this.audio = audio;

    this.DOM(type);
  }
  // generate ascii art
  getAscii() {
    return `<pre style="font: 10px/7px Courier New;">${ASCII.join("\n")}</pre>`;
  }
  // generate audio from base64
  getBase64() {
    var base64 = BASE_VAR;
    var typeWriter = new Audio(base64);
    typeWriter.loop = true;
    typeWriter.play();
  }
  // add element to the DOM
  addElement(content) {
    // Create a new div element
    const newDiv = document.createElement("div");
    // Set a unique ID for the new div
    newDiv.id = "GendalfId";
    // Set the style
    newDiv.style = "position: relative; z-index: 999999";
    // Add some content to the new div (optional)
    newDiv.innerHTML = content;
    // Append the new div to the body
    document.body.appendChild(newDiv);
  }
  // function that handle DOM
  DOM(type) {
    const ascii = this.getAscii();
    // choose the type of output
    switch (type) {
      // log to console ASCII + AUDIO
      case 0:
        console.log(ascii);
        break;

      // attach to the DOM by Id
      case 1:
        const html = document.getElementById(this.selector);
        // if the element exists
        if (html) {
          html.innerHTML = ascii;
        }
        break;

      // attach to the DOM by querySelector
      case 2:
        const query = document.querySelector(this.selector);
        // if the element exists
        if (query) {
          query.innerHTML = ascii;
        }
        break;

      // create a new element and attach to the DOM
      case 3:
        this.addElement(ascii);

        break;

      default:
        console.log(ascii);
    }

    // enable audio on demand
    if (this.audio) {
      this.getBase64();
    }
  }
}

